import React, { Component } from 'react';




class App extends Component {





  render(){
  return (
    <div className="App">

        <head>
          <script src="https://js-cdn.music.apple.com/musickit/v1/musickit.js"></script>

        </head>


      <button> Login to Spotify</button>


      <button> Login to Apple </button>

      <form>
        <label>Enter Spotify playlist URL</label>
        <input type = "text"></input>
        <input type="submit"></input>
      </form>

      <form>
        <label>Enter Apple playlist URL or URI</label>
        <input type = "text"></input>
        <input type="submit"></input>
      </form>

      <form>
        <label>Create Apple playlist</label>
        <input type = "text"></input>
        <input type="submit"></input>
      </form>

    </div>
  );
  }
}

export default App;
